function Main() {
    return (
        <main className="main">

          <section className="profile">
            <button className="profile__avatar-box">
              <img className="profile__avatar" src="./images/No_avatar.svg" alt="Аватар"/>
            </button>
                <div className="profile__info">
                   <div className="profile__name-container">
                     <h1 className="profile__name">Жаклин Кустодиев</h1>
                     <button className="profile__edit-button link" type="button" aria-label="Редактировать профиль"></button>
                   </div>
                   <p className="profile__job">Искатель лайков</p>
                </div>
              <button className="profile__add-button link" type="button" aria-label="Добавить"></button>
          </section>
          
          <section className="elements"></section>

        </main>
    )
}

function handleEditAvatarClick() {
    const profileAvatar = document.querySelector('.popup_apdate-avatar');
    profileAvatar.classList.add('open_popup');
}

function handleEditProfileClick() {
    const profileEdit = document.querySelector('.popup_edit-form');
    profileEdit.classList.add('open_popup');
}

function handleAddPlaceClick() {
    const placeAdd = document.querySelector('.popup_add-form');
    placeAdd.classList.add('open_popup');
}

export default Main
